import React from "react";
import Benefits from "./Benefits/Benefits";
import Featured from "./Featured/Featured";
import Hero from "./Hero/Hero";
import NavBar from "./Nav/NavBar";

const Landing = () => {
  return (
    <div>
      <NavBar />
      <Hero />
      <Benefits />
      <Featured />
    </div>
  );
};

export default Landing;
